import { expect, test } from "bun:test";

console.log("Hello via Bun!");

test('242. Valid Anagram', () => {
  expect(isAnagram("anagram","nagaram")).toBeTrue()
  expect(isAnagram("rat","car")).toBeFalse()
  expect(isAnagram("aa","a")).toBeFalse()
  expect(isAnagram("aacc","ccac")).toBeFalse()
  expect(isAnagram(
    "",
    ""
  )).toBeTrue()
})

function isAnagram(s: string, t: string): boolean {
  if (s.length !== t.length) { return false }

  let sCopy = s
  for (let c of t) {
    sCopy = sCopy.replace(c, '')
  }

  return sCopy.length === 0
}

